import { ExpenseItem } from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: "1",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "2",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      {expense.map((exp) => (
        <ExpenseItem exp={exp} key={exp.id} />
      ))}
    </div>
  );
}

export default App;
